pragma solidity >=0.4.21 <0.7.0;

/// @title Pay - Facilitates payments.
contract Pay {

    struct parties{
        uint256 holdings;
        address payable _to;
        address payable _from;
    }

    address initiator ;
    mapping(uint => parties) public payments;

    constructor () public{
         initiator = msg.sender;


    }

    event Payment(
        address _from,
        address payable _to,
        uint holdings
    );

    function pushIn(uint x) public payable {
        uint256 holdings = msg.value;
        payments[x] = parties(holdings, msg.sender, msg.sender);
    }

    function request(uint x) public payable {
        payments[x]._to =  msg.sender;
    }

    function pushOut(uint x) public payable {
        require(initiator == msg.sender);
        uint256 withdrawal = payments[x].holdings;
        payments[x].holdings = 0;
        (payments[x]._to).transfer(withdrawal);
        emit Payment(msg.sender,(payments[x]._to), msg.value);
    }
}
